Return to Top The relevant portions of the vulnerability advisory posted by Kaspersky is as follows: The other vulnerability, CVE-2021-31956, is a heap-based buffer overflow in ntfs.sys. The function NtfsQueryEaUserEaList processes a list of extended attributes for the file and stores the retrieved values to a buffer. This function is accessible via a ntoskrnl system call and among other things it's possible to control the size of the output buffer. If the size of the extended attribute is not aligned, the function will calculate a padding and the next extended attribute will be stored at a 32-bit alignment. The code then checks if the output buffer is long enough to fit the extended attribute with padding, but it doesn't check for a possible integer underflow. As a result, a heap-based buffer overflow can occur. The exploit uses CVE-2021-31956 alongside the Windows Notification Facility (WNF) to create arbitrary memory read and write primitives. We are planning to publish more information about this technique in the future. As the exploit uses CVE-2021-31955 to get the kernel address of the EPROCESS structure, it is able to use the common post-exploitation technique to steal the SYSTEM token. However, the exploit uses a rarely used "PreviousMode" technique instead. We have seen this technique used by the CHAINSHOT framework and even made a presentation about it at CanSecWest/BlueHat in 2019. The exploit then uses this technique to inject a malware module into the system process and executes it. Alongside the advisory, Kaspersky also posted the following pseudocode highlighting the vulnerable code in the NtfsQueryEaUserEaList function: for ( cur_ea_list_entry = ea_list; ; cur_ea_list_entry = next_ea_list_entry )
{ ... out_buf_pos = (DWORD *)(out_buf + padding + occupied_length); if ( NtfsLocateEaByName(eas_blocks_for_file, eas_blocks_size, &name, &ea_block_pos) ) { ea_block = eas_blocks_for_file + ea_block_pos; ea_block_size = ea_block->DataLength + ea_block->NameLength + 9; if ( ea_block_size <= out_buf_length - padding ) // integer-underflow is possible { memmove(out_buf_pos, (const void *)ea_block, ea_block_size); // heap buffer overflow *out_buf_pos = 0; } } else { ... } ... occupied_length += ea_block_size + padding; out_buf_length -= ea_block_size + padding; padding = ((ea_block_size + 3) & 0xFFFFFFFC) - ea_block_size; ...
} Based on the analysis performed by Y3A , we can summarize the advisory as follows: There is a heap-based buffer overflow from an integer-underflow in the ntfs.sys function NtfsQueryEaUserEaList which is accessible via a ntoskrnl.exe system call. After gaining a kernel-mode write primitive, the exploit uses CVE-2021-31956 with the Windows Notification Facility and an PreviousMode overwrite technique for the exploit's EPROCESS structure. We can now move onto finding the vulnerability ourselves.

