for ( cur_ea_list_entry = ea_list; ; cur_ea_list_entry = (unsigned int *)((char *)cur_ea_list_entry + *cur_ea_list_entry) ) { if ( cur_ea_list_entry == v11 ) { v15 = occupied_length; out_buf_pos = (_DWORD *)(out_buf + padding + occupied_length); if ( (unsigned __int8)NtfsLocateEaByName(eas_blocks_for_file, *(unsigned int *)(a3 + 4), &name, &ea_block_pos) ) { // WE ARE HERE } //... } //...
} We've now reached the vulnerable code inside of NtfsQueryEaUserEaList: Looking at the diagram above, we can see two specific things: According to the x64 fastcall calling convention, RDX is the second input parameter for a function call. In our case, we know that RDX is user-controlled as per the advisory from Kaspersky.Therefore, we move onto the second observation. If our controlled value is less than or equal to the output buffer length minus the padding, we pass the if condition. Now since we control half of the vulnerable if comparison, we should look further into what the other half entails. We continue to follow the basic block code path until we reach the code that sets the size of the padding: Here, based again off of the information provided in the advisory , we see that the padding is calculated in such a way to store the next extended attribute with a 32-bit alignment. This is where the vulnerability occurs. If an attacker is able to create a perfectly aligned output buffer, we would pass the check where the ea_block_size variable is less than or equal to the output buffer's length minus a padding of 0.

