Return to Top Now that we understand the context in which the vulnerability was originally used, let's explore the proof-of-concept Y3A of Star Labs created to exploit CVE-2021-31956. To start things off, we will examine the import section of the proof-of-concept. As with most C++ source code, the first section is usually a series of #include directives: #include <stdio.h>
#include <Windows.h>
#include <ntstatus.h>
#include <TlHelp32.h>
#include "CVE-2021-31956.h" As defined by Microsoft , the #include directive informs the C++ preprocessor to add the contents of the specified file at the location of the #include directive in the source code. Looking at the above code block, we notice the first four #include directives use angle bracket notation whereas the last #include directive uses the quotation notation to describe the target header file. According to the GNU Foundation , angle brackets or #include <file> are used to specify system header files. However, double quotation marks or #include "file" are used to define a user-generated header file. The search location for angle bracket #include directives is within a standard list of system directories whereas for double quotation mark #include directives the search location is within the directory of the source code.

