Return to Top Looking at the write64 function declaration, namely: void write64(ULONG_PTR addr, UINT64 data) We notice it has a return value of void indicating that it does not return a value. In addition, we see that it takes a Unsigned Long pointer and a Unsigned 64-bit integer as input. Examining the function definition we see the following: char buf[8] = { 0 };
ULONG wrote; *(UINT64 *)buf = data;
_NtWriteVirtualMemory(GetCurrentProcess(), (PVOID)addr, buf, 0x8, &wrote); return; First, a char array called buf and of size 8 with its elements initialized to 0. We also notice the variable wrote is declared of type ULONG. According to Microsoft , a ULong data type contains an 8-byte unsigned integer. Next, we see the pointer buf being cast to a pointer of type UINT64 before being dereferenced and given the value of data. As such, the datatype of the content pointed to by buf will now be interpreted as a UINT64, in this case as a 64-bit unsigned integer. Before examining the final line, let's look at the type definition for the NWVM datatype: typedef NTSTATUS (NTAPI *NWVM)( IN HANDLE ProcessHandle, IN PVOID BaseAddress, IN PVOID Buffer, IN ULONG NumberOfBytesToWrite, OUT PULONG NumberOfBytesWritten OPTIONAL
); We are looking at the type definition for NWVM as a function prototype for _NtWriteVirtualMemory does not exist in this file and it seems what the author did was use the NULL-pointer declaration and type-casting NWVM _NtWriteVirtualMemory = (NWVM)NULL; To create a NULL-pointer named _NtWriteVirtualMemory of type NWVM where they then called this pointer in the third to final line in write64: _NtWriteVirtualMemory(GetCurrentProcess(), (PVOID)addr, buf, 0x8, &wrote); As we can see from the NWVM datatype type definition, we have the following observations: The returned handle from GetCurrentProcess() is passed as ProcessHandle. The void pointer addr provided as the first input value is passed as BaseAddress. The Unsigned 64-bit integer pointer buf is passed as Buffer which has the void pointer datatype. The hexadecimal value 0x8 is passed as the Unsigned Long NumberOfBytesToWrite. The memory address &wrote is passed as the output buffer NumberOfBytesWritten. Interestingly enough, since _NtWriteVirtualMemory was not called as a function, but rather as a pointer to a structure, the return value is not assigned to a variable within the function. Instead after calling _NtWriteVirtualMemory, the function simply returns with no return value. Based on our analysis, we can conclude that the purpose of this function is to call NtWriteVirtualMemory and subsequently write the content buf at the location addr.

