); Here, we see a similar structure to that of _NtWriteVirtualMemory. As such, we won't go into as much detail except to break down the values passed from writ64 to the NULL-pointer function call: _NtReadVirtualMemory(GetCurrentProcess(), (PVOID)addr, buf, 0x8, &read); We can see the following: The HANDLE from GetCurrentProcess() is passed as ProcessHandle. The addr provided as input to write64 function is passed as the BaseAddress. The initialized buffer buf is then passed as the output buffer Buffer. The value 0x8 is passed as the NumberOfBytesToRead. The address to the Unsigned Long value read is passed as &read. Finally, the write64 function returns a pointer to the Unsigned 64-bit integer output buffer buf: return *(UINT64 *)buf; In conclusion, our analysis shows that the purpose of this function is call NtReadVirtualMemory and return the contents buf from the address addr.

