Return to Top Reviewing the blog post by Y3A , we see that the fix_runrefs function is used to clean up the heap after exploiting CVE-2021-31956. Reviewing the exploitation process covered in Exploitation Overview , We notice that in order to overwrite the target StateData pointer, the preceding members in the _WNF_NAME_INSTANCE data structure may also be overwritten. Reviewing the _WNF_NAME_INSTANCE data structure from the Vergilius Project , we see the following: //0xa8 bytes (sizeof)
struct _WNF_NAME_INSTANCE
{ struct _WNF_NODE_HEADER Header; //0x0 struct _EX_RUNDOWN_REF RunRef; //0x8 struct _RTL_BALANCED_NODE TreeLinks; //0x10 struct _WNF_STATE_NAME_STRUCT StateName; //0x28 struct _WNF_SCOPE_INSTANCE* ScopeInstance; //0x30 struct _WNF_STATE_NAME_REGISTRATION StateNameInfo; //0x38 struct _WNF_LOCK StateDataLock; //0x50 struct _WNF_STATE_DATA* StateData; //0x58 ULONG CurrentChangeStamp; //0x60 VOID* PermanentDataStore; //0x68 struct _WNF_LOCK StateSubscriptionListLock; //0x70 struct _LIST_ENTRY StateSubscriptionListHead; //0x78 struct _LIST_ENTRY TemporaryNameListEntry; //0x88 struct _EPROCESS* CreatorProcess; //0x98 LONG DataSubscribersCount; //0xa0 LONG CurrentDeliveryCount; //0xa4
}; As we can see, the RunRef member is located at an offset lower than that of StateData. As a result, it is possible for the RunRef member to be set to an invalid value during the exploitation process. If this is the case, the target system may crash and result in a Blue Screen of Death (BSOD). In order to prevent this from happening, the fix_runrefs function locates all affected _WNF_NAME_INSTANCE in memory by traversing the WnfContext field within our process's _EPROCESS. Once a _WNF_NAME_INSTANCE block is found, the RunRef member is set to 0. This is done since the RunRef member is a reference counter and by setting it to zero, we can avoid any issues if the system ever tries to use the this field. Examining the function declaration for fix_runrefs, we see the following: NTSTATUS fix_runrefs(_In_ PWNF_PROCESS_CONTEXT ctx) The first thing we notice the SAL Annotation _In_. SAL Annotation, or Source-code Annotation Language, is defined by Microsoft as: A set of annotations that you can use to describe how a function uses its parameters, the assumptions that it makes about them, and the guarantees that it makes when it finishes. Visual Studio code analysis for C++ uses SAL annotations to modify its analysis of functions. [...] Simply stated, SAL is an inexpensive way to let the compiler check your code for you. According to Microsoft, _In_ or Input to called function, is used as a way to label data as: Being passed to the called function, and is treated as read-only. Next, we examine the pointer declaration for PWNF_PROCESS_CONTEXT: typedef struct _WNF_PROCESS_CONTEXT
{ struct _WNF_NODE_HEADER Header; //0x0 struct _EPROCESS *Process; //0x8 struct _LIST_ENTRY WnfProcessesListEntry; //0x10 VOID *ImplicitScopeInstances[3]; //0x20 struct _WNF_LOCK TemporaryNamesListLock; //0x38 struct _LIST_ENTRY TemporaryNamesListHead; //0x40 struct _WNF_LOCK ProcessSubscriptionListLock; //0x50 struct _LIST_ENTRY ProcessSubscriptionListHead; //0x58 struct _WNF_LOCK DeliveryPendingListLock; //0x68 struct _LIST_ENTRY DeliveryPendingListHead; //0x70 struct _KEVENT *NotificationEvent; //0x80
} WNF_PROCESS_CONTEXT, *PWNF_PROCESS_CONTEXT; We now know that the value ctx is a pointer to a _WNF_PROCESS_CONTEXT structure and is treated as read-only. Now that we have an understanding of the function declaration, let's move onto the function definition for fix_runrefs. In particular, let's first examine the first variable definition: NTSTATUS status = STATUS_SUCCESS; As shown above, we have a variable status of type NTSTATUS that contains the value 0x00000000 otherwise known as STATUS_SUCCESS. Interestingly enough, this value seemingly does not change and will always return STATUS_SUCCESS at the end of the function. Let's move onto the head variable: PLIST_ENTRY head = (PLIST_ENTRY)read64(&(ctx->TemporaryNamesListHead)); The next variable is head, of type PLIST_ENTRY, and is set to the TemporaryNamesListHead member of the _WNF_PROCESS_CONTEXT structure pointed to by ctx. Let's take a moment to further break apart this variable definition. First, let's use the prototype provided by NirSoft to examine the data structure that PLIST_ENTRY points to: typedef struct _LIST_ENTRY
{ PLIST_ENTRY Flink; PLIST_ENTRY Blink;
} LIST_ENTRY, *PLIST_ENTRY; As we can see, PLIST_ENTRY points to a _LIST_ENTRY structure. In our case, this structure is located at the memory address found in the TemporaryNamesListHead member of the ctx pointer. Examining the _WNF_PROCESS_CONTEXT structure from the Vergilius Project , we see the following: //0x88 bytes (sizeof)
struct _WNF_PROCESS_CONTEXT
{ struct _WNF_NODE_HEADER Header; //0x0 struct _EPROCESS* Process; //0x8 struct _LIST_ENTRY WnfProcessesListEntry; //0x10 VOID* ImplicitScopeInstances[3]; //0x20 struct _WNF_LOCK TemporaryNamesListLock; //0x38 struct _LIST_ENTRY TemporaryNamesListHead; //0x40 struct _WNF_LOCK ProcessSubscriptionListLock; //0x50 struct _LIST_ENTRY ProcessSubscriptionListHead; //0x58 struct _WNF_LOCK DeliveryPendingListLock; //0x68 struct _LIST_ENTRY DeliveryPendingListHead; //0x70 struct _KEVENT* NotificationEvent; //0x80
}; The TemporaryNamesListHead is of type _LIST_ENTRY and based on the _LIST_ENTRY function prototype, we can assume that this value always points to the next _WNF_NAME_INSTANCE unless it is the last _WNF_NAME_INSTANCE data structure. In that case, the last _WNF_NAME_INSTANCE data structure would contain the same address in both the head and next variables. As briefly discussed, the next variable simply points to the address stored in the head variable. This is shown below: PLIST_ENTRY next = read64(head); Finally, the last variable definition in the fix_runrefs is below: PWNF_NAME_INSTANCE cur = CONTAINING_RECORD(next, WNF_NAME_INSTANCE, TemporaryNameListEntry); Here, we see that a variable called cur is a pointer to a _WNF_NAME_INSTANCE structure that contains the data structure pointed to by TemporaryNameListEntry. Based on the context of it's use, we can see that the pointer cur is used as a way to modify the RunRef member of any corrupted _WNF_NAME_INSTANCE data structures. We see this in action below: for (; next != head; next = read64(next), cur = CONTAINING_RECORD(next, WNF_NAME_INSTANCE, TemporaryNameListEntry)) if ((UINT64)read64(&(cur->Header)) != (UINT64)0x0000000000A80903) { write64(&(cur->Header), (UINT64)0x0000000000A80903); write64(&(cur->RunRef), (UINT64)0x0000000000000000); } As shown above, each _WNF_NAME_INSTANCE data structure is iteratively pointed to by cur and the Header member is read. If the Header member is not equal to the sane value 0x0000000000A80903, we then change both the Header member and the RunRef member to the sane values 0x0000000000A80903 and 0x0000000000000000, respectively. Finally, the fix_runrefs function outputs an update to the screen and returns the previously defined status: puts("[+] Fixed all overwritten header and runrefs"); return status;

