Return to Top According to MITRE , Token Stealing is defined as follows: Adversaries may modify access tokens to operate under a different user or system security context to perform actions and bypass access controls. Windows uses access tokens to determine the ownership of a running process. A user can manipulate access tokens to make a running process appear as though it is the child of a different process or belongs to someone other than the user that started the process. When this occurs, the process also takes on the security context associated with the new token. With this knowledge, Mantvydas Baranauskas provides a high-level overview of how Token Stealing is generally carried out: Open a process with access token you want to steal Get a handle to the access token of that process Make a duplicate of the access token present in that process Create a new process with the newly acquired access token Now that we know the general process attackers use in Token Stealing, we can adapt that methodology to how the steal_token function works. To start things off, let's first examine the steal_token function declaration: NTSTATUS steal_token(_In_ PEPROCESS own_eproc) We see that the steal_token function takes a single read-only EPROCESS pointer called own_eproc and returns an NTSTATUS value. We know that own_eproc is a pointer to an EPROCESS structure since the standard naming convention for pointer variables usually entails the following components: A P preceding a structure name. The type being in all capital letters. Moving on, we will now examine the first variable definition: NTSTATUS status = STATUS_UNSUCCESSFUL; The first variable, status is of type NTSTATUS and is initially set to the STATUS_UNSUCCESSFUL value 0xC0000001. However, if the steal_token function locates the SYSTEM process (0x4), the status value will be set to STATUS_SUCCESS. The following variable defined, next is shown below: PLIST_ENTRY next = (PLIST_ENTRY)read64(&(own_eproc->ActiveProcessLinks)); The next variable is a pointer to a _LIST_ENTRY structure which contains the _LIST_ENTRY data structure stored in the ActiveProcessLinks member of the own_eproc input pointer. This is important as ActiveProcessLinks can be used recursively to obtain the memory address of the next EPROCESS data structure in memory. PEPROCESS cur = CONTAINING_RECORD(next, EPROCESS, ActiveProcessLinks); Our next variable, cur is a pointer to an EPROCESS structure. According to Microsoft : The CONTAINING_RECORD macro returns the base address of an instance of a structure given the type of the structure and the address of a field within the containing structure. The CONTAINING_RECORD macro prototype is: void CONTAINING_RECORD( address, type, field
); Thus, the cur variable is a pointer to an EPROCESS structure that contains the next address pointing to the ActiveProcessLinks field. Within the CVE-2021-31956.h header file, we see that both EPROCESS and ActiveProcessLinks are defined as part of an abridged version of _EPROCESS: typedef struct
{ char padding1[0x440]; UINT64 UniqueProcessId; LIST_ENTRY ActiveProcessLinks; char padding2[0x60]; EX_FAST_REF Token; char padding3[0x3a8]; PWNF_PROCESS_CONTEXT WnfContext;
} EPROCESS, *PEPROCESS; Here, we see that the typedef is not overwriting the _EPROCESS function prototype. Rather, it is simply creating a skeleton to be assigned as EPROCESS and by PEPROCESS. Now that we have defined all variable assignments within the steal_token function, we will now proceed onto the main for loop: for (; cur != own_eproc; next = (PLIST_ENTRY)read64(next), cur = CONTAINING_RECORD(next, EPROCESS, ActiveProcessLinks)) if ((UINT64)read64(&(cur->UniqueProcessId)) == (UINT64)0x4) { write64(&(own_eproc->Token), read64(&(cur->Token))); status = STATUS_SUCCESS; puts("[+] Stole system token!"); goto out; } Since the ActiveProcessLinks structure is a circular doubly-linked list, the for loop will terminate if the current EPROCESS is equal to our own EPROCESS. So long as this is not the case, the next variable is set to point to the cur EPROCESS' ActiveProcessLinks address. Then, the cur EPROCESS is updated to the EPROCESS pointed to by the next variable. This in-turn allows the for loop to execute the if condition on every EPROCESS in memory. The UniqueProcessId for the SYSTEM EPROCESS is equal to 0x4. Therefore, the if condition checks if the cur EPROCESS has a UniqueProcessId of 0x4. If so, the Token member of the own_eproc EPROCESS, which is our own EPROCESS, will be overwritten with the Token member of the cur EPROCESS. The status value will then set to STATUS_SUCCESS and the for loop will break via the goto out statement. If there is no EPROCESS that has a UniqueProcessId of 0x4, a log_warn message will be issued and the STATUS_UNSUCCESSFUL status will be returned. However, if the goto out statement is executed, the program will skip the log_warn line and proceed to the out: section of code and return the STATUS_SUCCESS value: log_warn("Unable to find system process token"); out: return status;

