Return to Top Before discussing the specifics of the overflow_chunk function, let's first review how exactly the vulnerability can be reached from user-mode. According to the previously-covered advisory, this can be achieved through a ntoskrnl.exe system call (syscall). Therefore, we want to find any syscalls related to extended attributes (Ea). After looking through the Windows x64 syscall table provided by hfiref0x , we find the following two entries: Because the advisory mentioned the vulnerable function is called NtfsQueryEaUserEaList, we can make an educated guess and assume that the NtQueryEaFile syscall will eventually reach NtfsQueryEaUserEaList. The same logic is applied to the NtSetEaFile syscall. Thus, we will see the overflow_chunk using the NtSetEaFile syscall to create the conditions needed so that the syscall NtQueryEaFile can trigger the vulnerability. Now that we know the syscalls needed to invoke the vulnerability, let's examine it's usage within the overflow_chunk function starting with the function definition: NTSTATUS overflow_chunk(_In_ USHORT overflow_chunk_sz, _In_ char *overflow_data, _In_ USHORT overflow_data_sz) Before discussing the function definition for overflow_chunk, let's examine the values used when overflow_chunk is called in main: //CVE-2021-31956.h
#define OVERFLOW_DATA "\x00\x50\x00\x00\x00\x50\x00\x00\x00\x50\x00\x00\x00\x50\x00\x00\x00\x50\x00\x00\x00\x50\x00\x00"
#define OVERFLOW_SZ 0x18 The overflow_chunk function takes in three parameters: overflow_chunk_sz: A read-only unsigned short used as the EaValueLength value. overflow_data: A read-only pointer to a character buffer containing the bytes that will overflow into the neighboring data structure. As observed with the find_chunk function, this data is set to a series of 0x5000 values used as a magic number. overflow_data_sz: A read-only unsigned short that specifies the size of the memcopy used to overflow the buffer. Now that we have defined how the input parameters are used by overflow_chunk, we will now discuss the variable definitions found in the function: NTSTATUS status = STATUS_SUCCESS;
HANDLE file = INVALID_HANDLE_VALUE;
IO_STATUS_BLOCK x = { 0 };
FILE_FULL_EA_INFORMATION *fetched_data = zalloc(0x300);
FILE_GET_EA_INFORMATION *vuln_selector = zalloc(0x300);
FILE_GET_EA_INFORMATION *vuln_selector2;
FILE_FULL_EA_INFORMATION *payload = zalloc(0x300);
FILE_FULL_EA_INFORMATION *overflow; Let's now examine each variable in-depth: status: A variable returned after function execution of type NTSTATUS initialized to STATUS_SUCCESS. file: A handle to the file whose Extended Attributes will be exploited. Before examining x, let's first review what an IO_STATUS_BLOCK datatype is. According to Microsoft, A driver sets an IRP's I/O status block to indicate the final status of an I/O request, before calling IoCompleteRequest for the IRP. Thus, with this in mind, x is first initialized to 0 from which its reference will be passed to both NtSetEaFile and NtQueryEaFile. Let's now examine the fetched_data variable. According to NTInternals, NtQueryEaFile is used to read EA from NTFS file Let's examine the type definition for NtQueryEaFile's function prototype Y3A used in CVE-2021-31956.h: typedef NTSTATUS(*NQEF)( HANDLE FileHandle, PIO_STATUS_BLOCK IoStatusBlock, PVOID Buffer, ULONG Length, BOOLEAN ReturnSingleEntry, PVOID EaList, ULONG EaListLength, PULONG EaIndex, BOOLEAN RestartScan ); With this definition in mind, let's look to see how fetched_data is used in overflow_chunk: NtQueryEaFile(file, &x, fetched_data, 0xaa, FALSE, vuln_selector, 0x300, NULL, TRUE); We see fetched_data is a pointer to Buffer, were according to NTInternals, Buffer is defined as, Caller's allocated buffer for output data. However, in the context of our exploit, we will not use fetched_data after it is called. The focus of the exploit is to use NtQueryEaFile to overflow into the next data structure in memory. Let's now examine the variable vuln_selector. As with the fetched_data variable, this value also appears to be a pointer used in the function call to NtQueryEaFile. In the case of vuln_selector, it is used as the EaList pointer. According to NTInternals, EaList is described as: Optional list of FILE_GET_EA_INFORMATION structures containing names of EA Reviewing the usage of vuln_selector, we observe that it is used extensively to access the various properties of the first Extended Attribute defined by EANAME1 and provided in the FILE_GET_EA_INFORMATION structure. Reviewing the usage of vuln_selector, we observe that it is used extensively to access the various properties of the first Extended Attribute defined by EANAME1 and provided in the FILE_GET_EA_INFORMATION structure. Similar to vuln_selector, vuln_selector2 provides the same functionality except with the target Extended Attribute being defined by EANAME2. However, it is interesting to note that the pointer for vuln_selector2 is not allocated any memory initially. However, after being declared, the pointer vuln_selector2 is then assigned to the next Extended Attribute entry at the NextEntryOffset offset of vuln_selector. Now, let's examine the purpose of the payload pointer. We see it is of the FILE_FULL_EA_INFORMATION structure, which is the same structure as the fetched_data variable. However, in this case, it is used to create the payload which will be injected via the NtSetEaFile function call. Finally, let's examine the purpose of the overflow variable. As with both fetched_data and payload, overflow is initialized as a pointer to a FILE_FULL_EA_INFORMATION structure. However, in the case of overflow, it is not allocated memory and is simply declared. Within the context of the overflow_chunk function, overflow is used to get the next Extended Attribute entry at the NextEntryOffset offset of payload. Now that we have defined the variables used within overflow_chunk, let's look at the function's purpose starting with the API call to CreateFileA: file = CreateFileA("c:\\users\\username\\desktop\\placeholder.txt", GENERIC_READ | GENERIC_WRITE, FILE_SHARE_READ | FILE_SHARE_WRITE, NULL, CREATE_ALWAYS, FILE_ATTRIBUTE_NORMAL, NULL); Since the ExtendedAttributes are associated to a file, we first need to create a user-controlled file through the CreateFileA API. if (file == INVALID_HANDLE_VALUE) { log_warn("overflow_chunk::_CreateFileA()1"); goto out;
