vuln_selector->NextEntryOffset = (ULONG)0xc; Walking through the above code line by line we observe the first line sets the EaNameLength of the ExtendedAttribute pointed to by vuln_selector to the length of the EANAME1 value. According to CVE-2021-31956.h of Y3A's proof-of-concept, this value is set to the string abc. Next, a memcopy is performed copying EANAME1 to EaName with length EaNameLength. Finally, the NextEntryOffset is set to 0xC, which then allows vuln_selector2 to obtain the next ExtendedAttribute structure. vuln_selector2 = (PFILE_GET_EA_INFORMATION)((UINT64)vuln_selector + (UINT64)(vuln_selector->NextEntryOffset));
