Return to Top Before diving into the internals of the get_eproc function, let's take a step back and discuss the purpose of this function. According to Microsoft : The EPROCESS structure is an opaque structure that serves as the process object for a process. While we will soon see the importance of having the _EPROCESS address when we go through the main function, suffice to say that get_eproc is important in that it sets the stage for both enumeration and exploitation. Let's now look at the return type and parameter for get_eproc: NTSTATUS get_eproc(_Out_ PULONG_PTR eproc) First, the get_eproc function returns a NTSTATUS value upon completion. Next, a non-NULL PULONG_PTR pointer called eproc is passed to get_eproc. According to Microsoft , PULONG_PTR is: A pointer to a ULONG_PTR Where ULONG_PTR is: An unsigned LONG_PTR Where LONG_PTR is: A signed long type for pointer precision. Use when casting a pointer to a long to perform pointer arithmetic. While the recursive nature of the definition is oftentimes overbearing, sometimes it's good to always validate the definition of a type rather than constantly assuming it based on the naming convention. Next, let's review the variable definitions: NTSTATUS status = STATUS_UNSUCCESSFUL;
PSYSTEM_HANDLE_INFORMATION handle_info = NULL;
UINT64 handle_info_sz = 0x10000;
HANDLE current_proc = OpenProcess(PROCESS_QUERY_LIMITED_INFORMATION, FALSE, GetCurrentProcessId()); Let's now review each variable's purpose and implementation: status: Interestingly enough, unlike the previous functions we covered, get_eproc has a default status value of STATUS_UNSUCCESSFUL. This makes sense logically as the function needs to obtain the _EPROCESS value and if it does not have it, the function has failed. handle_info: A pointer to the below _SYSTEM_HANDLE_INFORMATION structure initially set to null. typedef struct _SYSTEM_HANDLE_INFORMATION
{ DWORD NumberOfHandles; SYSTEM_HANDLE Handles[1];
} SYSTEM_HANDLE_INFORMATION, *PSYSTEM_HANDLE_INFORMATION; handle_info_sz: The size of allocated memory to be used for the handle_info pointer. In our case it is set to 0x10000. current_proc: If successful, the call to the function OpenProcess will return a handle to the current process object. This will eventually be used Next, let's look into the memory allocation prepping our handle_info pointer for the NtQuerySystemInformation function call: printf("[+] Finding _EPROCESS address of current process: %ld\n", GetCurrentProcessId()); handle_info = (PSYSTEM_HANDLE_INFORMATION)zalloc(handle_info_sz);
if (!handle_info) { log_warn("get_eproc::zalloc()1"); status = STATUS_NO_MEMORY; goto out;
} After initializing the handle_info pointer to NULL, we now allocate the PSYSTEM_HANDLE_INFORMATION structure with a memory region of size handle_info_sz. If the allocation fails, the function terminates early and returns the NT_STATUS value STATUS_NO_MEMORY. With our memory allocation of handle_info complete, we will now enter a while loop that only breaks when the NT_STATUS return value of NtQuerySystemInformation is not equal to STATUS_INFO_LENGTH_MISMATCH. We will discuss in-detail later why the loop checks the NT_STATUS value against the constant STATUS_INFO_LENGTH_MISMATCH. But for now, let's look at the loop in its entirety: while ((status = _NtQuerySystemInformation( SystemHandleInformation, handle_info, handle_info_sz, NULL)) == STATUS_INFO_LENGTH_MISMATCH) { handle_info = realloc(handle_info, handle_info_sz *= 2); if (!handle_info) { log_warn("get_eproc::realloc()1"); status = STATUS_NO_MEMORY; goto out; }
} if (!NT_SUCCESS(status)) { log_warn("get_eproc::NtQuerySystemInformation()1"); goto out;
} During the loop, if the return value status of NtQuerySystemInformation is equal to STATUS_INFO_LENGTH_MISMATCH, the loop assigns the handle_info a new memory allocation with realloc where the size, handle_info_sz is multiplied by two each iteration. If the memory reallocation fails, the status is assigned the value STATUS_NO_MEMORY and the function terminates early. After the loop completes without any reallocation errors, the status value is checked against NT_STATUS and if it fails, the function again terminates early. Before moving to discuss the reasoning behind the STATUS_INFO_LENGTH_MISMATCH loop, let's break down NtQuerySystemInformation and first look at its function prototype: __kernel_entry NTSTATUS NtQuerySystemInformation( [in] SYSTEM_INFORMATION_CLASS SystemInformationClass, [in, out] PVOID SystemInformation, [in] ULONG SystemInformationLength, [out, optional] PULONG ReturnLength
); Let's now break down each parameter and how it's used within the context of our call with NtQuerySystemInformation: SystemHandleInformation: According to Geoff Chappell the hex value for SystemHandleInformation is 0x10 while the SYSTEM_INFORMATION_CLASS enumeration itself remains undocumented by Microsoft. handle_info: Because the size of the returned data is variable, the size of the buffer needs to be continually increased until the allocation size fits the return size. This is the reason why the STATUS_INFO_LENGTH_MISMATCH value is checked against the NtQuerySystemInformation call in a loop. If there is a length mismatch, likelihood is that the handle_info buffer needs to be increased in size. handle_info_sz: The length of the SystemInformation buffer pointed to by handle_info. NULL: The optional pointer to the ReturnLength value is set to NULL. Assuming that handle_info is populated with the data returned by NtQuerySystemInformation, we can now explore the for loop and how it's used to obtain the current process' _EPROCESS structure: printf("[+] Fetched %ld handles\n", handle_info->NumberOfHandles); for (int i = 0; i < handle_info->NumberOfHandles; i++) if (handle_info->Handles[i].dwProcessId == GetCurrentProcessId() && handle_info->Handles[i].wValue == current_proc) { status = STATUS_SUCCESS; printf("[+] _EPROCESS of current process: %p\n", handle_info->Handles[i].pAddress); *eproc = (ULONG_PTR)handle_info->Handles[i].pAddress; free(handle_info); goto out; } Within the for loop, while the counter i is less than handle_info->NumberOfHandles, each iterated handle's Process ID and the wValue is equal to current_proc, the status is set to STATUS_SUCESS, the eproc pointer is set to the ith pAddress, handle_info is freed, and the program goes to out. During execution, if get_eproc fails, the function jumps to out, closes the current_proc handle, and returns the NTSTATUS value status. If the function completes normally, this also occurs, but with the status value set to STATUS_SUCCESS: out: CloseHandle(current_proc); return status;

