Return to Top Let's now examine the create_cmd function beginning with its return value and input arguments: NTSTATUS create_cmd(void) We see that the create_cmd function returns a NTSTATUS type value while also taking no arguments as input parameters. Let's now walk through the variable declarations used for the CreateProcessA function call: char cmdl[] = "C:\\Windows\\System32\\cmd.exe";
STARTUPINFOA si = { 0 };
PROCESS_INFORMATION pi = { 0 };
BOOL res;
NTSTATUS status = STATUS_SUCCESS; si.cb = sizeof(STARTUPINFOA); Let's walk through each declaration line by line: cmdl: A character array containing the path to cmd.exe si: A STARTUPINFOA array initialized with the value 0. Where STARTUPINFOA specifies the window station, desktop, standard handles, and appearance of the main window for a process at creation time. pi: A PROCESS_INFORMATION array initialized with the value 0. Where PROCESS_INFORMATION contains information about a newly created process and its primary thread. res: An uninitialized boolean variable. status: A variable of type NSTATUS initialized to STATUS_SUCCESS Now, let's look at the call to CreateProcessA: res = CreateProcessA( cmdl, NULL, NULL, NULL, FALSE, CREATE_NEW_CONSOLE, NULL, NULL, &si, &pi
); Before we examine the call itself, let's look at the function prototype for CreateProcessA: BOOL CreateProcessA( [in, optional] LPCSTR lpApplicationName, [in, out, optional] LPSTR lpCommandLine, [in, optional] LPSECURITY_ATTRIBUTES lpProcessAttributes, [in, optional] LPSECURITY_ATTRIBUTES lpThreadAttributes, [in] BOOL bInheritHandles, [in] DWORD dwCreationFlags, [in, optional] LPVOID lpEnvironment, [in, optional] LPCSTR lpCurrentDirectory, [in] LPSTARTUPINFOA lpStartupInfo, [out] LPPROCESS_INFORMATION lpProcessInformation
); Let's now compare our call with each of the non-NULL parameter's descriptions from Microsoft : lpApplicationName: The name of the module to be executed. bInheritHandles: If the parameter is FALSE, the handles are not inherited. dwCreationFlags: For the flag CREATE_NEW_CONSOLE, the new process has a new console, instead of inheriting its parent's console (the default). lpStartupInfo: A pointer to a STARTUPINFO or STARTUPINFOEX structure. Where a STARTUPINFO structure specifies the window station, desktop, standard handles, and appearance of the main window for a process at creation time. lpProcessInformation: A pointer to a PROCESS_INFORMATION structure that receives identification information about the new process. If the CreateProcessA function succeeds, as per Microsoft's documentation , the handle for both the hProcess and hThread are closed for within the PROCESS_INFORMATION variable pi. If CreateProcessA fails, the function terminates early with the NTSTATUS value STATUS_UNSUCCESSFUL: if (!res) { log_warn("create_cmd::CreateProcessA()1"); status = STATUS_UNSUCCESSFUL; goto out;
} CloseHandle(pi.hProcess);
CloseHandle(pi.hThread); out:
return status;

