Return to Top The final function we will examine prior to discussing the main function is resolve_symbols. Let's first take a look at it's return type and input parameters, if any: NTSTATUS resolve_symbols(void) As with previous functions, the return type is NTSTATUS while the function does not take any input parameters. Let's now look at the three variable declarations before the GetModuleHandleA and LoadLibraryA calls are invoked: NTSTATUS status = STATUS_SUCCESS;
HMODULE ntdll = NULL, tmp = NULL; Here we see the status variable is set to STATUS_SUCCESS while the ntdll and tmp variables are of type HMODULE and are set to NULL. According to Microsoft , we see that an HMODULE is: A handle to a module. This is the base address of the module in memory Therefore now that we understand the data structure behind ntdll and tmp, let's now break down the calls to GetModuleHandleA and LoadLibraryA: puts("[+] Resolving internal functions..."); ntdll = ((tmp = GetModuleHandleA("ntdll.dll")) ? tmp : LoadLibraryA("ntdll.dll")); First, the GetModuleHandleA is called to retrieve the module handle for ntdll.dll and stores it in the tmp variable. If GetModuleHandleA fails, the value of tmp is NULL and LoadLibraryA is not called. If this occurs, the following code executes: if (ntdll == NULL) { log_warn("resolve_symbols::LoadLibraryA()1"); status = STATUS_NOT_FOUND; goto out;
} If not, LoadLibraryA is called and the base address for ntdll.dll is stored in the variable ntdll. Now that ntdll has the base address for ntdll.dll, we will now locate the process address for a series of functions using the GetProcAddress function call: _NtQuerySystemInformation = (NQSI)GetProcAddress(ntdll, "NtQuerySystemInformation");
_NtQueryEaFile = (NQEF)GetProcAddress(ntdll, "NtQueryEaFile");
_NtSetEaFile = (NQSI)GetProcAddress(ntdll, "NtSetEaFile");
_NtCreateWnfStateName = (NCWSN)GetProcAddress(ntdll, "NtCreateWnfStateName");
_NtUpdateWnfStateData = (NUWSD)GetProcAddress(ntdll, "NtUpdateWnfStateData");
_NtDeleteWnfStateName = (NDWSN)GetProcAddress(ntdll, "NtDeleteWnfStateName");
_NtDeleteWnfStateData = (NDWSD)GetProcAddress(ntdll, "NtDeleteWnfStateData");
_NtQueryWnfStateData = (NQWSD)GetProcAddress(ntdll, "NtQueryWnfStateData");
_NtReadVirtualMemory = (NRVM)GetProcAddress(ntdll, "NtReadVirtualMemory");
_NtWriteVirtualMemory = (NWVM)GetProcAddress(ntdll, "NtWriteVirtualMemory"); if (!_NtQuerySystemInformation || !_NtQueryEaFile || !_NtSetEaFile || !_NtCreateWnfStateName || !_NtUpdateWnfStateData || !_NtDeleteWnfStateName || !_NtDeleteWnfStateData || !_NtQueryWnfStateData || !_NtReadVirtualMemory || !_NtWriteVirtualMemory) { log_warn("resolve_symbols::GetProcAddress()1"); status = STATUS_NOT_FOUND; goto out;
} puts("[+] All functions resolved"); out: return status; If all functions are located, the status returns as STATUS_SUCCESS. However, if any of the functions are not found the status returns STATUS_NOT_FOUND. Interestingly enough, the way the code designed casts the data at the returned address to the respective function's datatype. This was created in advance and is useful in structuring the code to allow for dynamically locating a function from an existing process without needing a separate process to load a module.

